商品名：ソフラン　アロマリッチ　ソフィア 替え 増量<br>内容量：500ml<br>ブランド：ソフラン<br>原産国：日本<br><br>アロマカプセル配合。生まれたての香りが１日中長続き<br>【アロマカプセル配合。生まれたての香りが１日中つづく。まるでアロマのヴェールをまとうように、香りであなたを包み込む】・植物生まれの柔軟成分がセンイの１本１本まで柔らかく仕上げ、静電気も防ぎます。・防臭・抗菌※効果で、衣類につく汗やタバコなどのイヤなニオイを抑えます。・天然アロマオイル配合。●詰め替え増量品（１０％）<br>使用方法：必ずご使用前に表示をお読みください\n使い方\n全自動洗濯機の場合　柔軟(仕上げ)剤自動投入口に本品を入れて洗濯する(すすぎ時に自動で投入される)\n二槽式洗濯機、手洗いの場合　すすぎの水がきれいになったら本品を入れて約3分まわすか、ひたした後、脱水する\n＊洗濯機の設定に「ためすすぎ」と「注水すすぎ」がある場合は「ためすすぎ」を選んでください。\n\n使用量の目安　キャップ1杯は約43ml\n洗濯物量／水量／キャップ計量の目安\n6.0kg／65L／40ml→約1杯\n4.5kg／55L／30ml→3/<br><br>JANコード：4903301248569<br><br><br>商品番号：101-00932<br><br><br><br>区分： 洗剤・柔軟剤 <br><br><br><br>広告文責：アットライフ株式会社<BR>TEL 079-280-2113<BR>※商品パッケージは変更の場合あり。<BR>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<style>
